function ExeLogout() {
    if(localStorage.getItem('User')) {
        localStorage.removeItem('User')
        alert('Logged Out')
        window.location.assign('')
    }
    return (
        <div>
            Logging Out...
        </div>
    )
}

export default ExeLogout
